import { createRouter, createWebHistory } from "vue-router";

import Home from './components/FrontPage/index.vue'

const routes = createRouter({
    history: createWebHistory(),
    routes: [
        {path: '/', component: Home, name: 'home'}
    ]
})

export default routes
